data.v:
/^\s+product: / {
			product = $2;
			for (i=3; i<=NF; i++) product = product " " $i
		}
		/^\s+vendor: / {
			vendor = $2;
			for (i=3; i<=NF; i++) vendor = vendor " " $i
			printf "%s, %s\n", vendor, product;
			exit
		}

($0 ~ /CPU/) { if($(NF-1) ~ /gnice/){  NFIELDS=NF; } else {NFIELDS=NF+1;} next} /Average|Linux|^$|%/ {next} {datetime = strftime("%m/%d/%y_%H:%M:%S_%Z"); cpu=$(NF-6); pctUser=$(NF-5); pctNice=$(NF-4); pctSystem=$(NF-3); pctIowait=$(NF-2); pctIdle=$NF} {
    if ($0 ~ /all/) {
        print header;
        printf "%-28s %-3s  %9s  %9s  %9s  %9s  %9s\n", datetime, cpu, pctUser, pctNice, pctSystem, pctIowait, pctIdle;
    } else {
        printf "%-28s %-3s  %9s  %9s  %9s  %9s  %9s\n", datetime, cpu, pctUser, pctNice, pctSystem, pctIowait, pctIdle;
    }
    }
